import React, { Component } from 'react';
import { connect } from 'react-redux';

class Signup extends Component {
    render() {
        return (
            <div>
                Sign Up
            </div>
        )
    }
}

const mapStateToProps = state => ({
    auth: state.authReducer
})

export default connect(mapStateToProps, {})(Signup)
